import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#3498db', position: 'fixed', width: '100%', zIndex: 1000, top: '0' }}>
      <div className="container-fluid">
        <a className="navbar-brand" href="#">Quiz App</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          {/* Added inline styles to make links horizontally aligned */}
          <ul className="navbar-nav" style={{ display: 'flex', justifyContent: 'space-evenly', width: '100%' }}>
            <li className="nav-item">
              <Link className="nav-link" to="/home" style={linkStyles}>Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about" style={linkStyles}>About Us</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/quiz" style={linkStyles}>Quiz</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/profile" style={linkStyles}>Profile</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

// Custom inline styles for navbar links
const linkStyles = {
  fontSize: '1.1rem',
  fontWeight: '500',
  textTransform: 'uppercase',
  letterSpacing: '1px',
  padding: '10px 15px',
  transition: 'all 0.3s ease',
};

export default Navbar;
